import React from 'react';
import { useUrheilijat } from '../contexts/UrheilijatContext';

const UrheilijatList = () => {
  const { urheilijat } = useUrheilijat();

  return (
    <div>
      <h2>Urheilijat</h2>
      <ul>
        {urheilijat.map((urheilija) => (
          <li key={urheilija.id}>
            {urheilija.etunimi} {urheilija.sukunimi}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default UrheilijatList;
